  summary: Enumerates the elements of a <xref href="Bodu.Collections.Generic.EvictingDictionary%602" data-throw-if-not-resolved="false"></xref>.
  remarks: >-
    <p>

    Use the <a href="https://learn.microsoft.com/dotnet/csharp/language-reference/statements/iteration-statements#the-foreach-statement">foreach</a> statement to simplify the enumeration process instead

    of directly using this enumerator.

    </p>

    <p>

    The enumerator provides read-only access to the dictionary's elements. Modifying the

    underlying dictionary while enumerating invalidates the enumerator.

    </p>
